package LeetCode;

import org.junit.Assert;
import org.junit.Test;

public class PalindromePartitioningIITest {

	@Test
	public void test() {
		PalindromePartitioningII s = new PalindromePartitioningII();
		Assert.assertEquals(1, s.minCut("aab"));
		Assert.assertEquals(0, s.minCut("aaa"));
		Assert.assertEquals(0, s.minCut("a"));
		Assert.assertEquals(0, s.minCut(""));
		s.minCut("");
	}

}
